function sumArray(array) {
	const sum = array.filter(Number.isFinite) 
				   .reduce((acc, num) => acc + num, 0); 
	return sum;
}

function getHighLow(num) {
	const high = (num >>> 8) & 0xFF; 
	const low = num & 0xFF; 
	return { high, low }; 
  }

function sendColors(shutdown = false)
{
	
	let RGBData = grabColors();
	for(var index = 0; index < 7; index++) 
  {
		let packet = [];
		let rgbPeriod = [];
		rgbPeriod.push(...RGBData.splice(0, MaxLedsInPacket));
		if (index >=5)
		{
			var  RGB_Total = sumArray(rgbPeriod)+((index-5)* MaxLedsInPacket)+ 0x63;
		} 
		else
		{
			var  RGB_Total = sumArray(rgbPeriod)+(index* MaxLedsInPacket)+ 0x4A;
		}	
		// var  RGB_Total = sumArray(rgbPeriod)+(index* MaxLedsInPacket)+ 0x4A;
		packet[0] = 0x04;
		//const bit1 = [0x32,0x24,0x1f,0x6b,0x15,0x5e,0xc7]
		//const bit2 = [0x2f,0x30,0x2e,0x26,0x24,0x22,0x2b]
		packet[1] = getHighLow(RGB_Total).low;
		packet[2] = getHighLow(RGB_Total).high;
		//packet[1] = 0x00;
		//packet[2] = 0x00;
		packet[3] = 0x12;
		packet[4] = 0x38;
		if (index == 6)
		{
			packet[4] = 0x30;
		}
		//const bit5 = [0x00,0x38,0x70,0xa8,0xe0,0x18,0x50]
		//const bit6 = [0x00,0x00,0x00,0x00,0x00,0x01,0x01]
		//packet[5] = bit5[index];
		//packet[6] = bit6[index];
		packet[5] = getHighLow(index * MaxLedsInPacket).low;
		packet[6] = getHighLow(index * MaxLedsInPacket).high;
		packet[7] = 0x00;
		
		packet = packet.concat(rgbPeriod);
		device.write(packet, 64);
		// device.log(packet);
		device.pause(0);
  }
}
function grabColors(shutdown = false) 
{
	let rgbdata = [];

	for(let iIdx = 0; iIdx < vKeys.length; iIdx++)
	{
		let iPxX = vKeyPositions[iIdx][0];
		let iPxY = vKeyPositions[iIdx][1];
		let color;

		if(shutdown)
		{
			color = hexToRgb(shutdownColor);
		}
		else if (LightingMode === "Forced")
		{
			color = hexToRgb(forcedColor);
		}
		else
		{
			color = device.color(iPxX, iPxY);
		}

		let iLedIdx = vKeys[iIdx] * 3;
		rgbdata[iLedIdx] = color[0];
		rgbdata[iLedIdx+1] = color[1];
		rgbdata[iLedIdx+2] = color[2];
	}

	let Fill = new Array(24).fill(0);
	rgbdata = rgbdata.concat(Fill);
	return rgbdata;
}

function hexToRgb(hex) 
{
	let result = /^#?([a-f\d]{2})([a-f\d]{2})([a-f\d]{2})$/i.exec(hex);
	let colors = [];
	colors[0] = parseInt(result[1], 16);
	colors[1] = parseInt(result[2], 16);
	colors[2] = parseInt(result[3], 16);

	return colors;
}



export function Validate(endpoint) {
	return endpoint.interface === 1 && endpoint.usage === 0x0092 && endpoint.usage_page === 0xff1c;
}

